{
 int bank, index;

 if (!name)
  return -22;

 if ((gpio >= 1024)) {

  index = gpio - 1024;
  sprintf(name, "GPIO%d", index);
 } else {

  bank = gpio / 32;
  index = gpio % 32;
  sprintf(name, "P%c%d", ('A' + bank), index);
 }

 return 0;
}
