static ssize_t ehci_ed_test(struct device *dev, struct device_attribute *attr,
  const char *buf, size_t count)
{
 __u32 test_mode = 0;
 struct usb_hcd *hcd = ((void *)0);
 struct ehci_hcd *ehci = ((void *)0);

 if (dev == ((void *)0)) {
  printk("\001" "3" "hci: ""ERR: Argment is invalid\n");
  return 0;
 }

 hcd = dev_get_drvdata(dev);
 if (hcd == ((void *)0)) {
  printk("\001" "3" "hci: ""ERR: hcd is null\n");
  return 0;
 }

 ehci = hcd_to_ehci(hcd);
 if (ehci == ((void *)0)) {
  printk("\001" "3" "hci: ""ERR: ehci is null\n");
  return 0;
 }

 mutex_lock(&dev->mutex);

 printk("ehci_ed_test:%s\n", buf);

 if (!strncmp(buf, "test_not_operating", 18)) {
  test_mode = (0x0<<16);
  printk("test_mode:0x%x\n", test_mode);
 } else if (!strncmp(buf, "test_j_state", 12)) {
  test_mode = (0x1<<16);
  printk("test_mode:0x%x\n", test_mode);
 } else if (!strncmp(buf, "test_k_state", 12)) {
  test_mode = (0x2<<16);
  printk("test_mode:0x%x\n", test_mode);
 } else if (!strncmp(buf, "test_se0_nak", 12)) {
  test_mode = (0x3<<16);
  printk("test_mode:0x%x\n", test_mode);
 } else if (!strncmp(buf, "test_pack", 9)) {
  test_mode = (0x4<<16);
  printk("test_mode:0x%x\n", test_mode);
 } else if (!strncmp(buf, "test_force_enable", 17)) {
  test_mode = (0x5<<16);
  printk("test_mode:0x%x\n", test_mode);
 } else if (!strncmp(buf, "test_mask", 9)) {
  test_mode = (0xf<<16);
  printk("test_mode:0x%x\n", test_mode);
 } else {
  printk("\001" "3" "hci: ""ERR: test_mode Argment is invalid\n");
  mutex_unlock(&dev->mutex);
  return count;
 }

 printk("regs: 0x%p\n", hcd->regs);
 __ehci_ed_test(ehci, hcd->regs, test_mode);

 mutex_unlock(&dev->mutex);

 return count;
}

